const Dashboard = (props) => {

	return (

			<div className={"block"}>
				<div className={"block bg-silver"}>
					<div>{"Wallet (5)"}</div>
					<div className={"flex justify-content between"}></div>
				</div>

				<div className={"bg-teal"}>
					{"Activity"}
				</div>
			</div>

		);
}

export default Dashboard;
